import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import * as serviceWorker from "./serviceWorker";
import { createBrowserHistory } from "history";
import { Router, Route, Switch } from "react-router-dom";
import withLayout from "./utils/with-layout";
import RecruimentPage from "./components/recruimentPage";
import AnalysistPage from "./components/Analysist";
import HomePage from './components/Home'

var hist = createBrowserHistory();

ReactDOM.render(
  <Router history={hist}>
    <Switch>
      <Route path="/recruitment-news" component={withLayout(RecruimentPage)} />
      <Route path="/analysist" component={withLayout(AnalysistPage)} />
      <Route path="/" component={withLayout(HomePage)} />
    </Switch>
  </Router>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
